import React from "react";
import {Link} from 'react-router-dom'
import "./Navbar.css"

function Navbar(){
    return(
        <div class="header">
            <link to="/">ToDoList</link>
            <ul >
                <li>
                    <Link to="/categories">Categories</Link>
                </li>
            </ul>
        </div>
    )
}

export default Navbar;
